import React from "react";
import './Login.css';
import logo from './logo.svg';


function Login() {
    return (
      <div className="login container-fluid">
        
        <img className="logo" src={logo} alt="logo"/>

        <div className="box-principale">
          <text className="ben-tornato">Ben tornato</text>
          <text className="inserisci-credenziali">Inserisci le credenziali per accedere</text>
          <input className="input-inserisci-mail" placeholder="Inserisci la tua mail"></input>
          <input className="input-inserisci-password" type="Password" placeholder="Inserisci la tua password"></input>
          <button className="button-entra">Entra</button> 
        </div>

        <text className="password-dimenticata">Password dimenticata? <a href="?">Resetta la password</a></text>
 
      </div>
    );
  }
  

  export default Login;
